var b="url",c="2-2__상품정보관리_상품정보조회.html",d="generationDate",e=new Date(1511155852595.41),f="isCanvasEnabled",g=false,h="isAdaptiveEnabled",i="sketchKeys",j="",k="s0",l="variables",m="OnLoadVariable",n="page",o="packageId",p="6c99b315c5224562b90461733f2c97d5",q="type",r="Axure:Page",s="name",t="2-2. 상품정보관리_상품정보조회",u="notes",v="개발자 참고사항",w="<p><span>통합상품DB의 도서정보를 불러오며, 수정은 별도의 통합상품관리자(별도제작)에서 합니다. </span></p><p><span>불러들이는 정보는, 통합상품DB와 매칭됩니다.</span></p><p><span>전집과, 한글단행본의 경우 기존 세원북의 DB와 신규로 제공받아 올리는 데이터에 약간의 차이가 있으나, 새로 제공받을 도서정보의 필드에 맞게 전집과 아동도서도 데이터 값을 수정해야 할 필요가 있을 것 같습니다. (별도 통합상품정보 운영안 문서를 참고해주세요.) </span></p><p><span>이미지의 경우, 통합상품관리자에 리사이징 컴포넌트를 설치하여 1회 대표이미지를 업로드 하면 이미지서버에 세원북, 오픈북에서 필요한 사이즈로 자동으로 Resizing되어서 저장이 되도록 개발할 필요가 있을 것 같습니다.</span></p>",x="style",y="baseStyle",z="627587b6038d43cca051c114ac41ad32",A="pageAlignment",B="near",C="fill",D="fillType",E="solid",F="color",G=0xFFFFFFFF,H="image",I="imageHorizontalAlignment",J="imageVerticalAlignment",K="imageRepeat",L="auto",M="favicon",N="sketchFactor",O="0",P="colorStyle",Q="appliedColor",R="fontName",S="Applied Font",T="borderWidth",U="adaptiveStyles",V="interactionMap",W="diagram",X="objects",Y="id",Z="1baf00490c8b4bce83179e7f5c34c37e",ba="label",bb="friendlyType",bc="Global_Menu",bd="referenceDiagramObject",be="styleType",bf="visible",bg=true,bh="2284dc7da5db4769b78c17c5fcb9f958",bi="location",bj="x",bk=10,bl="y",bm="size",bn="width",bo=1,bp="height",bq="imageOverrides",br="masterId",bs="6cf9bf1526334cb781d7454917d26bc2",bt="8abe0ba849f844d0b7413b4ea355f4c5",bu="Rectangle",bv="vectorShape",bw="foreGroundFill",bx=0xFF000000,by="opacity",bz=130,bA=80,bB=870,bC=90,bD="fontSize",bE="12px",bF="fontWeight",bG="normal",bH="fontStyle",bI="borderFill",bJ=0xFF666666,bK="images",bL="normal~",bM="images/2-1__상품정보관리_상품목록/u9660.png",bN="generateCompound",bO="38af13d01ea44ac89af3e99d21008ae7",bP="'Helvetica-Bold', 'Helvetica Bold', 'Helvetica'",bQ="700",bR="13px",bS="horizontalAlignment",bT="left",bU=140,bV=88,bW=150,b